import React, {useState} from 'react';
import Lab from './Lab'
import {Grid } from '@mui/material'
import { makeStyles } from '@material-ui/core'
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CardActionArea from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import Divider from '@mui/material/Divider';

let labsOne = [
  {
    name: 'Outline',
    date: '2022-08-21',
    description: 'Collaborative Outline',
    link: '',
  },
  {
    name: "Byron",
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Lance',
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Jason',
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Chris',
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Paula',
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Glossary',
    date: '',
    description: '',
    link: '',
  },
]
let labsTwo = [
  {
    name: 'Lab1',
    date: '2022-08-21',
    description: 'Market Research regarding competitors in the field',
    link: "https://docs.google.com/presentation/d/e/2PACX-1vTS89QcB--Q6or6xUOgKlixJtGctIgtiDiFgeDJwdvfus4C0ou2kmiIhxyYVyEKoqiZEYTulZLjuVa9/embed?start=false&loop=false&delayms=3000"
  },
  {
    name: 'Lab2',
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Lab3',
    date: '',
    description: '',
    link: '',
  },
]
let labsThree = [
  {
    name: 'Lab1',
    date: '2022-08-21',
    description: 'Market Research regarding competitors in the field',
    link: '',
  },
  {
    name: 'Lab2',
    date: '',
    description: '',
    link: '',
  },
  {
    name: 'Lab3',
    date: '',
    description: '',
    link: '',
  },
]
const Labs = () => {

  return (
    <div>
      <div id="problem">
              <Typography variant='h3'>
            Lab I
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {labsOne.map((lab) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <Lab key={lab.name} lab={lab} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <br></br>
      <div id="problem">
              <Typography variant='h3'>
            Lab II
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {labsTwo.map((lab) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <Lab key={lab.name} lab={lab} />
            </Grid>
          )
          })}
      </Grid>
      </div>
      <div id="problem">
              <Typography variant='h3'>
            Lab III
        </Typography>
        <Divider>
          </Divider>
            <Grid container spacing={2}>
        {labsThree.map((lab) => {
          return (
            <Grid item xs={12} sm={6} md={4}>
              <Lab key={lab.name} lab={lab} />
            </Grid>
          )
          })}
      </Grid>
      </div>
    </div>
  )
}

export default Labs
